import BlogList from "./BlogList";
import useFetch from "./useFetch";
import logo from "./gustaakh-saale2-nobg2 (1)";

const Home = () => {
  const { error, isPending, data: blogs } = useFetch('http://localhost:8000/blogs')

  return (
    <div className="home">
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
      { blogs && <BlogList blogs={blogs} /> }
      <img src="/home/asus/Desktop/react/my-app/public/Gustaakh_Saale_logo.jpg" alt="gustaakh saale" />
    </div>
  );
}

export default Home;
